import React from 'react';
import { Menu } from 'semantic-ui-react';

export default (props) => {
    return (
        <div className="header">
            <style jsx>{`
            .header {
                height: 5%;
                z-index: 10;                
            }
        `}</style>
            <Menu secondary>
                <link
                    rel="stylesheet"
                    href="//cdn.jsdelivr.net/npm/semantic-ui@2.4.2/dist/semantic.min.css"
                />
                <Menu.Item name='BlockVotes' style={{ verticalAlign: 'middle', fontFamily: "Freestyle Script", fontSize: '40px', paddingLeft: '42%', paddingTop: '2%' }} />
                <Menu.Menu position='right'>
                    <Menu.Item
                        icon="user"
                        name='Election Commission'                        
                    />
                </Menu.Menu>
            </Menu>
            <hr />
            {props.children}
        </div>
    );
};
